package service

import (
	"encoding/json"
	"testing"

	"github.com/shiguanghuxian/poster/program/config"
	"github.com/shiguanghuxian/poster/program/logger"
)

func TestMain(m *testing.M) {
	// 配置文件
	cfg, err := config.LoadConfig("../../bin/config/cfg.toml")
	if err != nil {
		panic(err)
	}

	// 日志对象
	_, err = logger.InitLogger(cfg.LogPath, cfg.Debug)
	if err != nil {
		panic(err)
	}
	m.Run()
}

func TestDrawPoster(t *testing.T) {
	for i := 0; i < 100; i++ {
		req := new(PosterParam)
		json.Unmarshal([]byte(reqStr), req)
		s, err := NewService(req)
		if err != nil {
			t.Fatal(err)
		}
		_, err = s.DrawPoster()
		if err != nil {
			t.Fatal(err)
		}
	}
}

