func BenchmarkDrawPoster(b *testing.B) {
	for i := 0; i < b.N; i++ {
		req := new(PosterParam)
		json.Unmarshal([]byte(reqStr), req)
		s, err := NewService(req)
		if err != nil {
			b.Fatal(err)
		}
		_, err = s.DrawPoster()
		if err != nil {
			b.Fatal(err)
		}
	}
}

